import React from 'react';
import servicesData from '../data/services'
import tst from '../data'

function Home() {
  return (
      <div className="row">
        <h2>What we do</h2>
        <div className="col-4">
          <div className="list-group" id="list-tab" role="tablist">
            {servicesData.map((service, key) => (
              <a key={key} className="list-group-item list-group-item-action" id={`list-${service.name}-list`} data-toggle="list" href={`#list-${service.name}`} role="tab" aria-controls={`${service.name}`}>{`${service.title}`}</a>
            ))}
          </div>
        </div>
        <div className="col-8">
          <div className="tab-content" id="nav-tabContent">
            {servicesData.map((service, key) => (
              <div 
                key={key} className="tab-pane fade" id={`list-${service.name}`} role="tabpanel" aria-labelledby={`list-${service.name}-list`}>
                <p>{service.description}</p>
                <a href={`${service.flyer}`} download="test.pdf">
                  <button type="button" className="btn btn-outline-info">Download flyer</button>
                </a>
                <button type="button" className="btn btn-outline-primary">Get in touch</button>
                <img className="service-images w-100 d-block" src={service.img} />
              </div>
            ))}
          </div>
        </div>
      </div>  
  );
}

export default Home;
